import { InMemoryDbService } from 'angular-in-memory-web-api';
import {Subject} from './subject';

export class InMemoryDataService implements InMemoryDbService {
  createDb() {
    const subjects = [
      { id: 11, name: 'Mr. Nice',pictureBase64:'', category:'others' },
      { id: 12, name: 'Narco',pictureBase64:'', category:'' },
      { id: 13, name: 'Bombasto' ,pictureBase64:'', category:''},
      { id: 14, name: 'Celeritas',pictureBase64:'', category:'' },
      { id: 15, name: 'Magneta' ,pictureBase64:'', category:''},
      { id: 16, name: 'RubberMan',pictureBase64:'', category:'' },
      { id: 17, name: 'Dynama',pictureBase64:'', category:'' },
      { id: 18, name: 'Dr IQ' ,pictureBase64:'', category:''},
      { id: 19, name: 'Magma' ,pictureBase64:'', category:''},
      { id: 20, name: 'Tornado',pictureBase64:'data:image/png;base64,' , category:''}
    ];
    return {subjects};
  }

  // Overrides the genId method to ensure that a hero always has an id.
  // If the heroes array is empty,
  // the method below returns the initial number (11).
  // if the heroes array is not empty, the method below returns the highest
  // hero id + 1.
  genId(subjects: Subject[]): number {
    return subjects.length > 0 ? Math.max(...subjects.map(subject => subject.id)) + 1 : 11;
  }
}